fn invoke_ffi_init_funcs() {
    unsafe extern "C" {
        fn __sinit_array();
        fn __einit_array();
    }
    let call_len = (__einit_array as *const () as usize - __sinit_array as *const () as usize) / 8;
    for i in 0..call_len {
        unsafe {
            let function = (__sinit_array as *const () as usize + 8 * i) as *const fn();
            (*function)();
        }
    }
}
